ttp://en.wikipedia.org/wiki/File:Hernando_de_Magallanes_del_museo_Madrid.jpg"><img src="http://upload.wikimedia.org/wikipedia/commons/thumb/0/05/Hernando_de_Magallanes_del_museo_Madrid.jpg/220px-Hernando_de_Magallanes_del_museo_Madrid.jpg" border="0" width="161" height="200" style="float: right;" /></a>Voyage of Magellan</h2>\r\n<p><strong>Ferdinand Magellan</strong> (Spring 1480 – April 27, 1521, Mactan Island,  Cebu, Philippines) was a Portuguese maritime explorer who, while in the  service of the Spanish Crown, tried to find a westward route to the  Spice Islands of Indonesia. This was the first successful attempt to  circumnavigate the Earth in history. Although he did not complete the  entire voyage (he was killed during the Battle of Mactan in the  Philippines) fellow Basque-navigator Juan Sebastian Elcano completed the  final westward voyage. As Magellan traveled farther west than the Spice  Islands, which he had visited on earlier voyages from the west, he  became one of the first individuals to cross all the meridians of the  globe. He was the first person to lead an expedition sailing westward  from Europe to Asia and to cross the Pacific Ocean.</p>\r\n<p><a href="http://en.wikipedia.org/wiki/Ferdinand_Magellan" target="_blank">Read More ></a></p>'),
